import { useDispatch } from "react-redux";
import React, { useEffect } from 'react';
import { getNoticesCategory } from "../";

import NoticeCategoryItem from '../NoticeCategoryItem/NoticeCategoryItem';
import css from './NoticesCategorieslist.module.scss';
import {noticies} from '../../noticies';
const NoticesList = ({ onClick, onClickModal}) => {
    const dispatch = useDispatch();

    useEffect(()=> {
        dispatch(getNoticesCategory());
    }, [dispatch])

    return (
        <ul className={css.list}>
            {noticies.map(({ id, category, image, location, date, sex}) => (
                <NoticeCategoryItem
                    key={id}
                    category={category}
                    image={image}
                    location={location}
                    date={date}
                    sex={sex}
                    onClick={onClick}
                    onClickModal={onClickModal}
                />
            ))}
        </ul>
    );
};

NoticesList.defaultProps = {
    noticies: [],
}

export default NoticesList;
